sys_variable_value.value:
(function execute(inputs, outputs) {
var prepolicyArr=inputs.previousPolicy.previousPolicy;
var array=[];
outputs.prepolicy_obj={};
prepolicyArr.forEach(function(prepolicy){
    array.push({
        "stringval1":prepolicy.policyOrProposalNumbers||"",
        "stringval2":prepolicy.insuranceCompany||"",
        "stringval3":prepolicy.amountOfInsurance||"",
        "stringval4":prepolicy.status||""
    })
})
var prepolicy_obj={
    "WeoRecStrings150User":array
}
outputs.prepolicy_obj=prepolicy_obj
})(inputs, outputs);

