(function execute(inputs, outputs) {
 var qArr=(inputs.hlth.questionaire_list);
     var array=[];

outputs.questionairearr={};
qArr.forEach(function(question){
    array.push({
        "stringval1":question.questionID||""  ,
        "stringval2": question.subQuestionID!="" ? question.subQuestionID : "",
        "stringval3":question.questionAnswer||"",
